    data: |
      SELECT DISTINCT + ( + col1 ) AS col2 FROM tab2 WHERE + col0 + CAST ( + col2 AS INTEGER ) - + - col1 NOT IN ( - col0 / col0, col1 / + + col0 );
  - name: tab2

outputs:
  - name: q5748.out
    data: |
      51
      67
      77
